class Drink(db.Model):
  """Models an Individual Drink"""
  number = db.IntegerProperty()
  name = db.StringProperty()
  alcohol = db.StringProperty()
  url = db.StringProperty()

curdate=datetime.now()
curdate=curdate.replace(tzinfo=pacific)

class MainPage(webapp.RequestHandler):
    def get(self):
        number=random.randrange(0,222)
        if curdate.month==3 and curdate.day==17:
        	specialtext="It's fucking St. Patrick's Day!"
        	name="Irish Car Bomb"
        	alcohol="Beer"
        	url="http://en.wikipedia.org/wiki/Irish_Car_Bomb"
       	else:
	        specialtext=''
	        name=drinklist[number][0]
	        alcohol=drinklist[number][1]
	        url=drinklist[number][2]

        template_values = {
            'name': name,
            'specialtext': specialtext,
            'alcohol': alcohol,
            'url': url,
        }

        path = os.path.join(os.path.dirname(__file__), 'index.html')
        self.response.out.write(template.render(path, template_values))


application = webapp.WSGIApplication([
  ('/', MainPage)
], debug=True)


def main():
  run_wsgi_app(application)


if __name__ == '__main__':
  main()